Category: Feature, Parody / Spoof

Cast: Allie Haze, Tommy Gunn, Ava Addams, August Ames, Anikka Albrite, Ralph Long, Brittany Andrews, Kasey Warner, Brandon Iron, Dava Foxx, Gabby Quinteros


.:Description:.
It was just a matter of time until DEADPOOL got the porn parody treatment, courtesy of legendary director Ralph Long and adult powerhouse SPIZOO Entertainment... and it was worth the wait! Wolverine (played by AVN winner Tommy Gunn), Rogue, Domino (played by AVN winner Allie Haze). Ms Marvel (played by AVN winner Anikka Albrite). Kitty Pryde (Brittany Andrews first feature in 3 years), and Lady Death (Ava Addams) join forces with Professor X to defeat the villains lead by Stryker (Brandon Iron), in yet another Ralph Long masterpiece bound to become an instant classic.
Take a look at screenshots! Enjoy!
